Mine was at Walmart. We needed some chemicals for our swimming pool and other odds and ends and we stopped in after my son's 2 week check up.

He was sleeping in his infant carseat so we simply clicked it in the stroller to venture in the store. I pushed the stroller, my husband grabbed a cart because what we needed would be too much to carry.

Fast forward about 20 mins and we have a full cart and my husband has to use the restroom so he leaves me with the stroller and cart in the middle aisle of the store.

And my son starts screaming. Like - let me make sure something sharp hasn't suddenly impaled him - kind of screaming.😭

He's fine. Diaper is dry. I try to breast feed him. He's still screaming. Won't latch. People are definitely looking my direction now.

I decide that I should try to exit the store but realize that I can't push the stroller and the cart at the same time. (I realized this because I tried and failed all while my son screamed louder because I put him back in the stroller)

I decide to abandon the cart and will text husbandbut then notice that his phone is in the drink holder of the stroller.🤦‍♀️

Lack of sleep is likely what prevented me from the logical reasoning that I should just abandon the cart. I should have left everything there but I'm only 2 weeks in on this whole "mom" thing so instead, I freeze.🥺

I stood in the middle of Walmart holding my son while he screamed and my husband took FOREVER in the bathroom until miraculously my baby burped and fell back asleep. 😲

And then my husband came scampering up the aisle.🤬

Well maybe he wasn't scampering but as far as I was concerned, he was way too chipper.

And I will never ever forget that moment.  And I will always offer to help when I see a mom in a similar situation. 🤗 #womensupportingwomen

